import React, { useState } from "react";
import "./hero_btn.css";

const Hero_button = () => {
  const [moseOver, setMouseOver] = useState(false);
  function herobtn_over() {
    setMouseOver(true);
  }
  function heobtn_leave() {
    setMouseOver(false);
  }


//   function downloadFile (){
// return (
//     {

//     }
// )
//   }
  const style = {
    backgroundColor: moseOver ? "crimson" : "black",
    color: moseOver ? "black" : "crimson",
    border: moseOver ? "black" : "white",
  };
  
  return (
    <div className="hero-buttons">
      <button
        style={style}
        className="hero_btn"
        onMouseOver={herobtn_over}
        onMouseLeave={heobtn_leave}
        // onClick={downloadFile}
      >
      <a href="https://drive.google.com/file/d/1YM-ye3bVBZ_zda8hTcgLtKm1zjDNPx-I/view?usp=drive_link" className="hero_btn"> Download CV</a> 
      </button>
      
      <a href="" className="socialIcon"><i class="fa-brands fa-linkedin-in"></i></a>
      <a href="" className="socialIcon"><i class="fa-brands fa-github"></i></a>
      <a href="" className="socialIcon"><i class="fa-solid fa-x"></i></a>
    </div>
  );
};

export default Hero_button;
